}
/*--universal section--*/

*{
    padding: 0;
    margin: 0;
}

/*--body section--*/

body{
    display: inline;
    background-color: black;
}

/*-- section--*/

.section{
    display: flex;
    justify-content: center;
}

/*--top section--*/

.top{
    display: flex;
    position: relative;
    width: 40%;
    justify-content: center;
    margin-top: 20px;
}
.top img{
    height: 30px;
    display: grid;
    opacity: 0.2;
}


/*--navigation section--*/

.nav{
    display: flex;
    justify-content: center;
}
nav{
    display: inline;
    position: relative;
    margin-top: -15px;
}
.nav ul{
    position: relative;
    word-spacing: 30px;
}
.nav ul li{
    display: contents;
    text-decoration: none;
}
.nav ul li a{
    display: contents;
    color:  rgb(173, 113, 1);
    text-decoration: none;
    font-family: font10;     /*font10  */
    font-size: 13px;
}
ul li a:hover,ul li:hover{
    color: wheat; 
    background-color: aliceblue;
}
ul:hover{
cursor: default;
}
/* styling total home */
.allhome{
    display: flex;                       /* display property flex */
    position: relative;
    justify-content: center;
}
/*--content section--*/
.content {
    display: inline;
    position: relative;
}
.content img{
    position: relative;
    display: inline;
    height: 290px;
    opacity: 0.1;
    animation: blink 2s infinite;
    margin-left: -10px;
    filter: drop-shadow(4px 4px 2px hsla(125, 96%, 46%, 0.822));
    bottom: -240px;

}
@keyframes blink{
    0%,25%{
opacity: 0.2;
    }
    30%,50%{
        opacity: 0.1;
    }
    35%,45%{
        opacity: 0;
    }
    60%,65%{
        opacity: 0;
    }
    55%,75%{
        opacity: 0.1;
    }
    80%,100%{
        opacity: 0;
    }
}
.content h2{
display: grid;
position: relative;
color: rgb(173, 113, 1);
font-size: 50px;
font-family: font1;    
}

.content h1{
    display: grid;
    color: slategrey;
    font-family: font10;    
    font-size: 80px;
    margin-top: -30px;
    margin-bottom: -25px;
}
.content p{
    display: grid;
    position: relative;
    color: rgb(196, 196, 196);
    font-family: font7;/* font11*/
    font-size: 35px;
    animation: downslide alternate;
    animation-timing-function: ;

}
.content .words{
    display: inline;
    position: relative;
    top: -160px;
}
.titles{
    top: -150px;
}
.content h2,h1,p:hover{
     cursor: default;
}

/*--button section--*/


.button{
    display: flex;
    position: relative;
    justify-content: space-around;
    top: -150px;
    width: 88%;
}
.button button{
    display: inline;
    position: relative;
    font-family: font10;
    padding: 10px 16px;
    background-color:  rgb( 255,255, 255,0.1);
    backdrop-filter: blur(10px);
    color: white;
    border: 1px solid rgb(173, 104, 0);
    border-radius: 12.5px;
    letter-spacing: 1px;
    height: fit-content;
}
.button .button1{
    letter-spacing: 2px;
    padding: 10px 30px;
}
.button .button2{
    margin-left: 50px;
}
button:hover{
    color: black;
    background-color: whitesmoke;
}

/* about the aauthor */
.fullabout{
    display: none;         /* display property inline */
}
.detail{
    display: flex;
    justify-content: center;
}
